import React from 'react';
import Firebase, { FirebaseContext } from '../firebase';
import SignIn from '../signIn';

class Home extends React.Component{
    render(){
        return (
            <FirebaseContext.Consumer>
                {
                    firebase => {
                        <SignIn firebase = {firebase}></SignIn>
                    }
                }
            </FirebaseContext.Consumer>

        );
    }
}

export default Home;
